import React, {Component} from 'react';
import './navbar.scss'
import {Link, Route} from 'react-router-dom'



class Footer extends Component{
    constructor(props){
        super(props)
        this.cookie = []
        this.state={

        }
    }

    onclick_button=(button_name)=> {
        if(button_name == 'facebook'){
            window.location.href = 'https://www.facebook.com/profile.php?id=100002120343748&ref=bookmarks';  //window.location.href跳转
        }

    }

    scrollTOP=()=>{
        window.scrollTo(0,0);
    }


    render(){ 

        return(
            <React.Fragment>
               <div className="FootContainer">
                    <div className="container">
                        <ul className="flex">


                            <li><Link onClick={this.onclick_button('facebook')} to="/" ><i class="fab fa-facebook-square"></i></Link></li>
                            <li><Link to="/">Google+</Link></li>
                            <li><Link to="/">LinkIn</Link></li>
                            <li><Link to="/">Contact me</Link></li>
                        </ul>
                    </div>
               </div>
            </React.Fragment>
        )
    }
}


export default Footer
